import React from 'react';
import Header from './Header';
import Menu from './Menu';
import Menu2 from './Menu2';
import Menu3 from './Menu3';
import './App.css';

export default class App extends React.Component {
  render() {
    return (
      <div className='App'>
        <Header />
        <Menu />
        <Menu2 />
        <Menu3 />
      </div>
    );
  }
}
